import Head from '../components/Header';
import Header from '../components/Header';
import Footer from '../components/Footer';
import Player from '../components/Player';

const Layout = ({ children, title }) => (
	<div className="App">
		<Head>
			<title>{title}</title>
		</Head>
		<Header />

		<main>
			{children}
		</main>

		<Player />
		
		<Footer />
	</div>
);

export default Layout;
